INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d230-7b8c-8000-0c0905022b29', 'Vi har fått tilstrekkelig støtte til å gjennomføre tiltak basert på egen arbeidsmiljøundersøkelse', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d35a-7964-8000-9976b6195748', 'Vi har opparbeidet oss nødvendig kompetanse til å følge opp fremtidige arbeidsmiljøundersøkelser', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d48a-7212-8000-a37822095484', 'Vi har en personalpolitikk som ivaretar ansattes behov i ulike deler av livet (f.eks. graviditet, førpensjon)', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d5a1-7a3f-8000-c2e0036515d1', 'Vi har utarbeidet gode rutiner for hvordan vi tilrettelegger ansattes arbeid i ulike deler av livet', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d6d2-7a51-8000-e3c6851e30af', 'Vi får tilbakemeldinger om at ansatte med psykiske plager blir godt ivaretatt', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d7fd-7640-8000-abbb8ad235ea', 'Som leder, tillitsvalgt eller verneombud har jeg opparbeidet meg ferdigheter til å møte og støtte ansatte med psykiske plager', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-d91d-7840-8000-667bac4b62bc', 'Vi jobber kontinuerlig for å redusere stigma rundt psykiske plager', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-da46-7c11-8000-e46079df4ce9', 'Vi har fått økt kompetanse om tilrettelegging for ansatte med muskel-, skjelett- og psykiske plager', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-db78-7df7-8000-265dfad26d7e', 'Ansatte ønsker i større grad å jobbe til tross for muskel-, skjelett- og psykiske plager', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-dcac-712a-8000-b5cafa93edd1', 'Vi har opparbeidet oss et godt grunnlag for å jobbe videre med arbeidsmiljøet vårt', false);
INSERT INTO public.ia_sak_kartlegging_sporsmal VALUES ('06740ca9-ddce-72d1-8000-d92919c20caf', 'Vi har utarbeidet konkrete planer for hvordan vi skal videreutvikle arbeidsmiljøet vårt', false);
